css:
atom-text-editor,
:host {
  background-color: #11232D;
  color: #c5c8c6;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #6A6A6A;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #11232D;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #1B3451;
  color: #66CCCC;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #66CCCC;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #6A6A6A;
}
atom-text-editor .cursor,
:host .cursor {
  color: #E19938;
}
atom-text-editor .highlight-selected.region,
:host .highlight-selected.region {
  border: 1px solid #F99157;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #1B5E78;
  border: 1px solid #F99157;
  border-radius: 3px;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid white;
}
.comment {
  color: #999999;
}
.keyword {
  color: #b294bb;
}
.keyword.control {
  color: #b294bb;
}
.keyword.operator {
  color: #66CCCC;
}
.keyword.other.special-method {
  color: #6699CC;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #CC99CC;
}
.constant {
  color: #de935f;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #de935f;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.variable {
  color: #FC6C76;
}
.variable.interpolation {
  color: #fb3a47;
}
.variable.parameter.function {
  color: #6699CC;
}
.invalid.illegal {
  background-color: #FC6C76;
  color: #11232D;
}
.string {
  color: #99CC99;
}
.string.quoted .begin,
.string.quoted .end {
  color: #66CCCC;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #FC6C76;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #c5c8c6;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #6699CC;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #c5c8c6;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #8abeb7;
}
.support.function.any-method {
  color: #6699CC;
}
.entity.name.function {
  color: #6699CC;
}
.entity.name.type {
  color: #f0c674;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #6699CC;
}
.entity.name.tag {
  color: #FC6C76;
}
.entity.other.attribute-name {
  color: #BB80B3;
}
.entity.other.attribute-name.id {
  color: #6699CC;
}
.meta.brace {
  color: inherit;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #6699CC;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #c5c8c6;
}
.meta.function .readwrite {
  color: #F99157;
}
.meta.property-list .property-name {
  color: #FFCC66;
}
.none {
  color: #c5c8c6;
}
.markup.bold {
  color: #de935f;
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #FC6C76;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #6699CC;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #FC6C76;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
